            machinePartyList: {},
            vehiclePartyList: {},
            purchasePartyList: {}
        }

        this.fetchProduct = this.fetchProduct.bind(this);
        this.fetchProduct();
    }

    componentDidMount(){
      console.log("Compoenent did mount start...");
    }

